ex was started as a research project in 1974 to continue this series. The BES conducted interview surveys following the general elections of February 1974, October 1974 and May 1979. This series also includes a questionnaire survey conducted after the Referendum on Britain's membership of the EEC in 1975. The series was continued under the changed name of British General Election Studies (BGES). Since 1983 it has been directed by Anthony Heath, Roger Jowell and John Curtice and carried out jointly by SCPR and Nuffield College Oxford. The 1992 BES surveys were carried out as part of the activities of the ESRC-funded Joint Unit for the Study of Social Trends (JUSST). The 1997 studies were carried out by its successor, CREST, in collaboration with Pippa Norris of Harvard University, with funding from the ESRC, the Gatsby Charitable Foundation and the Commission for Racial Equality. The 1997 British General Election Study included a greater number of separate but inter-linked studies than ever before.",qLb='The URL ',AVb='The app may be out of date. Reload this page in your browser.',dQb='The response could not be deserialized',aQb='This application is out of date, please click the refresh button on your browser.',bQb='This application is out of date, please click the refresh button on your browser. ( ',CVb='This is taking too long, try again',UQb="This widget's parent does not implement HasWidgets",u3b='Throwable',Iac='Throwable;',v2b='Thu',occ='Time',w5b='TimeZone',p3b='Timer',V6b='Timer$1',pcc='Timestamp',qNb='Too many percent/per mille characters in pattern "',rRb='Top',M4b='TouchCancelEvent',N4b='TouchEndEvent',L4b='TouchEvent',O4b='TouchEvent$TouchSupportDetector',P4b='TouchMoveEvent',B6b='TouchScroller',C6b='TouchScroller$1',D6b='TouchScroller$2',E6b='TouchScroller$3',F6b='TouchScroller$4',G6b='TouchScroller$5',H6b='TouchScroller$6',I6b='TouchScroller$MomentumCommand',J6b='TouchScroller$MomentumCommand$1',K6b='TouchScroller$MomentumTouchRemovalCommand',L6b='Touch
